import './ExpenseItem.css';

function ExpensesItem() {
  const edate = new Date(2023,1,1);
  const etitle = "Car Item";
  const eprice = 546;
  return (
    <div className="expense-item">
      <div>{edate.toLocaleDateString()}</div>
      <div className="expense-item__description"><h2>{etitle}</h2></div> 
      <div className="expense-item__price">${eprice}</div>
    </div>
  );
}
export default ExpensesItem;
